  modalButton: {
    padding: ['0.7rem', '1.8rem'],
    width: '100%',
    backgroundColor: 'transparent',
    border: 0,
    fontSize: '1rem',
    color: '#fff',
    cursor: 'pointer',
    marginBottom: '0',
    display: 'flex',
    justifyContent: 'center',
    hidden: true,
    backgroundImage: 'linear-gradient(transparent, black)',
    '&:hover': {
    },
  },

  launcherWrapper: {
    bottom: '0px',
